"use strict";

export const SVG_NAMESPACE_URI = "http://www.w3.org/2000/svg";
export const LEFT_MOUSE_BUTTON = 0;
export const RIGHT_MOUSE_BUTTON = 2;
export const MIDDLE_MOUSE_BUTTON = 1;

export default {
  LEFT_MOUSE_BUTTON,
  RIGHT_MOUSE_BUTTON,
  MIDDLE_MOUSE_BUTTON
};
